import {
  GET_LIST_CATALOG,
  GET_LIST_CATALOG_SUCCESS,
} from "../constants/catalog";
import {
  GET_LIST_PRODUCT,
  GET_LIST_PRODUCT_SUCCESS,
} from "../constants/product";
export const getListCatalog = (payload) => {
  return {
    type: GET_LIST_CATALOG,
    payload,
  };
};

export const getListCatalogSuccess = (payload) => {
  return {
    type: GET_LIST_CATALOG_SUCCESS,
    payload,
  };
};

export const getListProduct = (payload) => {
  return {
    type: GET_LIST_PRODUCT,
    payload,
  };
};

export const getListProductSuccess = (payload) => {
  return {
    type: GET_LIST_PRODUCT_SUCCESS,
    payload,
  };
};
